DELETE BB 
FROM #TempBankBranchIndia BB
INNER JOIN dbo.API_BANK_BRANCH_LIST ABB
ON	BB.BRANCH_CODE=ABB.BRANCH_CODE1 AND ABB.IS_ACTIVE=1

UPDATE	tbb
SET	tbb.BANK_CODE=ABL.BANK_ID
FROM #TempBankBranchIndia tbb
INNER JOIN dbo.API_BANK_LIST ABL ON ABL.BANK_CODE1=tbb.BANK_CODE

INSERT INTO dbo.API_BANK_BRANCH_LIST
        ( 
			BANK_ID ,BRANCH_NAME ,BRANCH_CODE1 ,BRANCH_CODE2 ,BRANCH_STATE ,BRANCH_DISTRICT ,BRANCH_ADDRESS ,
			BRANCH_PHONE ,BRANCH_EMAIL ,BRANCH_COUNTRY ,IS_ACTIVE ,PAYMENT_TYPE_ID
        )
SELECT		BANK_CODE,Branch_Name,Branch_Code,NULL,Branch_State,Branch_District,Branch_City,
			NULL,NULL,'INDIA',1,2
FROM #TempBankBranchIndia
